using SITDApiSubmission.API.Models;
using SITDApiSubmission.UnitTests.TraffixAPI;
using System.Net;

[TestFixture]
public class TraffixApiClientFunctionalTests : TraffixApiUnitTestAbstract
{
    [Test]
    public void TraffixApiIsNotNull()
    {
        // Assert
        Assert.That(TraffixApiClient, Is.Not.Null);
    }

    [Test]
    public void CarrierDetails()
    {
        // Arrange
        var callerVendorId = "TV-246048";
        var mcNumber = "MC400210";
        // Act
        var carriers = TraffixApiClient.GetAsync(OcpApimSubscriptionKey).Result;

        // Assert
        Assert.That(carriers, Is.Not.EqualTo(null));
        Assert.Multiple(() =>
        {
            Assert.That(carriers?.Data?.CallerVendorId, Is.EqualTo(callerVendorId), "Caller vendor id does not match.");
            Assert.That(carriers?.Data?.FactoredCarriers?.First().MCNumber, Is.EqualTo(mcNumber), "Motor carrier number does not match.");
        });
    }

    [Test]
    public void LoadDocuments()
    {
        // Create new object
        // Arrange
        var newDocument = new LoadDocumentsTraffix();
        var loadNumber = "T00640514";//"A-461061";
        var carrierVendorId = "TV-213354";
        newDocument.LoadNumber = loadNumber;
        newDocument.CarrierVendorId = carrierVendorId;
        newDocument.Documents = new List<DocumentTraffix>();
        var doc = new DocumentTraffix
        {
            FileName = "testDoc.pdf",
            Data = ""
        };
        newDocument.Documents.Add(doc);

        // Act
        var errorResp = TraffixApiClient.PostAsync(OcpApimSubscriptionKey, newDocument).Result;

        // Assert
        Assert.That(errorResp?.StatusCode, Is.EqualTo((int)HttpStatusCode.OK), errorResp?.Message ?? "Failed to send documents");
    }
}
